import React, { Component } from 'react';
import images from "./images.json";
import './App.css';
import Jumbotron from './components/jumbotron/index'

class App extends Component {
  state = {
    images
  };

  render() {
    return (
      <Jumbotron />
    )
  }
}

export default App;
